-- ----------------------------
-- Table structure for valveinfo
-- ----------------------------
DROP TABLE IF EXISTS `valveinfo`;
CREATE TABLE `valveinfo` (
  `reportNo` varchar(255) NOT NULL,
  `companyUse` varchar(255) DEFAULT NULL,
  `companyAddress` varchar(255) DEFAULT NULL,
  `companyContacts` varchar(255) DEFAULT NULL,
  `telephone` varchar(255) DEFAULT NULL,
  `deviceNo` varchar(255) DEFAULT NULL,
  `installLocation` varchar(255) DEFAULT NULL,
  `valveType` varchar(255) DEFAULT NULL,
  `valveModel` varchar(255) DEFAULT NULL,
  `workPressure` varchar(255) DEFAULT NULL,
  `workMedium` varchar(255) DEFAULT NULL,
  `requireSettingPressure` varchar(255) DEFAULT NULL,
  `standard` varchar(255) DEFAULT NULL,
  `sealTestPressure` varchar(255) DEFAULT NULL COMMENT '平均密封实验压力',
  `settingPressure` varchar(255) DEFAULT NULL COMMENT '平均试验实际整定压力',
  `checkMode` varchar(255) DEFAULT NULL COMMENT '校验方式',
  `checkMedium` varchar(255) DEFAULT NULL COMMENT '校验介质',
  `checkResult` varchar(255) DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `checkExplain` varchar(255) DEFAULT NULL COMMENT '维护检修情况说明',
  `checkSignature` longtext COMMENT '审核人的电子签名',
  `approveSignature` longtext COMMENT '审批人的电子签名',
  PRIMARY KEY (`reportNo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

